- input: "TEXT\x1CC00305318\x1C.TEXT\x1C\x1CF3XA\x1CThe original Report included a
    voided $5,000 contribution to the Kansas Democratic Party of April 23, 2008. The
    voided contribution check was dated May 11, 2007. Notwithstanding the fact that
    the contribution was over a year old and stale-dated, the Committee just learned
    that the 5/11/07 contribution check was cashed by its bank on July 9, 2008. Thus,
    the Committee is deleting the voided contribution to the Kansas Democratic Party
    contained in its original May 20th Report. The Committee has requested a $5,000
    refund from the Kansas Democratic Party, and expects to receive this refund shortly."
